import React from "react";
import Navbar from "../components/NavBar";
import '../styles/Products.css';

const Categorias = () => {
    return (
        <div>
            <Navbar />
            <h3 className="titlePRODUCTOS">RELOJES DEPORTIVOS</h3>
            <div className="containerPRODCUTOS">
                <div className="opcionC reloj1">
                    <div className="categoriaTexto">RELOJ 111111</div>
                </div>
                <div className="opcionC reloj2">
                    <div className="categoriaTexto">RELOJ 222222</div>
                </div>
                <div className="opcionC reloj3">
                    <div className="categoriaTexto">RELOJ 333333</div>
                </div>
            </div>
        </div>
    );
};

export default Categorias;
